import * as React from "react";
import { Layout } from "../components";

export default function About() {
  console.log("dest deploy");

  class Bruh {
    bruh: number;
    constructor() {
      this.bruh = 0;
    }

    countUp() {
      this.bruh++;
    }
  }

  const countbruhUp = () => {
    const bruh = new Bruh();
    bruh.countUp();
    bruh.countUp();
    return bruh.bruh;
  };

  console.log(countbruhUp());
  return (
    <Layout>
      <main>My about page</main>
    </Layout>
  );
}
